import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Conta from './pages/Conta';
import Home from './pages/Home';

function App(): any {


  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Home />} />

        <Route path='/conta' element={<Conta />}/>

      </Routes>
    </BrowserRouter>   
  );
}

export default App;
